import React, { Component } from 'react'

export default class Login extends Component {
    render() {
        return (
            <div className='login-main'>
                <form>
                <input type='email' placeholder='email'></input>
                <input type='password' placeholder='password'></input>
                <button type='submit' />
                </form>
            </div>
        )
    }
}
